import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { useHistory } from 'react-router-dom'

import {HashRouter} from 'react-router-dom'


ReactDOM.render(
  <HashRouter>
    <App history={ useHistory } /> 
  </HashRouter>, document.getElementById('root')
)
